import React from "react";
import "./Projects.styles.css";
import TitleProjects from "./SubComponents/TitleProjects";

function Projects() {
  return (
    <div className="projects main-content">
      <TitleProjects />
      <div className="projects-container">
        <h2>My Projects</h2>
      </div>
    </div>
  );
}

export default Projects;
